        protected override void OnCreate(Bundle savedInstanceState)
        {
            //Call techs and candidates
            rd = new readData();
            techRd = rd.Techs(rd.techData);
            candRd = rd.Cands(rd.candData);

            base.OnCreate(savedInstanceState);
            Xamarin.Essentials.Platform.Init(this, savedInstanceState);
            // Set our view from the "main" layout resource
            SetContentView(Resource.Layout.activity_main);

            techList = FindViewById<AutoCompleteTextView>(Resource.Id.txtTechnology);
            txtYOE = FindViewById<EditText>(Resource.Id.txtYears);
            searchCandidates = FindViewById<ImageButton>(Resource.Id.btnSearch);
            choosenOnes = FindViewById<Button>(Resource.Id.btnChoosenOnes);
            
            candList = FindViewById<RecyclerView>(Resource.Id.listCandidates);
            swipe = new ImplementSwipeHelper(this, candList, 200);

            //List Technologies names in a string array for AutoComplete field
            ArrayAdapter txtFieldList = new ArrayAdapter<string>(this, Android.Resource.Layout.SimpleSpinnerItem);

            foreach (Technologies t in techRd)
            {
                txtFieldList.Add(t.name);
            }
            techList.Adapter = txtFieldList;
            //Set Click  function to Search button click event
            searchCandidates.Click += OnSearchButtonClick;
            choosenOnes.Click += OnChoosenOnesClick;

        }
        //Button Search Click Event
        void OnSearchButtonClick(object sender, System.EventArgs e)
        {
            /*
              Get the name and years of experience typed in Text Editors
              Search in Technology List the guid of selected technology
              Search in Candidates List all candidates that have experience in selected technology with igual or more years of experience defined
             */
            //Intantiate a new list of serach result
            List<Candidates> selectCandidates = new List<Candidates>();
            //Removin All Child from View... Set Original State
            candList.RemoveAllViews();
            candList.RefreshDrawableState();
            //Search Users that have experience in select Technology
            int years;
            if (txtYOE.Text == ""){
                years = 0;
            }else{
                years = int.Parse(txtYOE.Text);
            }
            //Verify if the text field was filled
            if (techList.Text == "")
            {
                Toast.MakeText(this, "Please Choose a Technology", ToastLength.Short).Show();
            }
            else
            {
                //Start search process...
                //Searching Technogoly guid
                string techGUID = "";
                foreach (Technologies t in techRd)
                {
                    if (t.name == techList.Text)
                    {
                        techGUID = t.guid;
                        break;
                    }
                }
                if (techGUID != "")
                {
                    foreach (Candidates c in candRd)
                    {
                        if (c.status == 0)
                        {
                            Experience[] ex = c.experience;

                            foreach (Experience exp in ex)
                            {
                                if (exp.technologyId == techGUID)
                                {
                                    if (exp.yearsOfExperience >= years)
                                    {
                                        //Include the candidate to selectedCandidates list
                                        selectCandidates.Add(c);
                                        break;
                                    }
                                }
                            }
                        }
                    }
                }
                else
                {
                    Toast.MakeText(this, "Technology Not Found!!", ToastLength.Short).Show();
                }
                if (selectCandidates.Count > 0)
                {
                    //Create new Swipe List and include the candidates
                    Toast.MakeText(this, "Total of " + selectCandidates.Count.ToString() + " Founded!", ToastLength.Short).Show();
                    menuAdapter = new IfsAdapter(this, selectCandidates, techGUID);
                    candList.HasFixedSize = true;
                    layoutManager = new LinearLayoutManager(this);
                    candList.SetLayoutManager(layoutManager);

                    candList.SetAdapter(menuAdapter);
                    swipe.refreshVariables(selectCandidates, techGUID);
                    


                }
                else
                {
                    Toast.MakeText(this, "No candidates where founded!", ToastLength.Short).Show();
                }
            }
        }
        void OnChoosenOnesClick(object sender, System.EventArgs e)
        {
            candList.RemoveAllViews();
            candList.RefreshDrawableState();
            string techGUID = "";
            List<Candidates> choosenCandidates = new List<Candidates>();
            foreach (Technologies t in techRd)
            {
                if (t.name == techList.Text)
                {
                    techGUID = t.guid;
                    break;
                }
            }
            if (techGUID != "")
            {
                foreach (Candidates c in candRd)
                {
                    if (c.status == 1)
                    {
                        Experience[] ex = c.experience;

                        foreach (Experience exp in ex)
                        {
                            if (exp.technologyId == techGUID)
                            {
                                //Include the candidate to selectedCandidates list
                                choosenCandidates.Add(c);
                                break;
                            }
                        }
                    }
                }
                if (choosenCandidates.Count > 0)
                {
                    menuAdapter = new IfsAdapter(this, choosenCandidates, techGUID);
                    candList.HasFixedSize = false;
                    layoutManager = new LinearLayoutManager(this);
                    candList.SetLayoutManager(layoutManager);
                    candList.SetAdapter(menuAdapter);
                }
                else
                {
                    Toast.MakeText(this, "No candidates where founded!", ToastLength.Short).Show();
                }
            }
            else
            {
                Toast.MakeText(this, "Technology Not Found!!", ToastLength.Short).Show();
            }

        }
        
