        //Implement the Swipe function in the Candidates List
        private class ImplementSwipeHelper : SwipeHelper
        {
            Context context;
            RecyclerView recyclerView;
            int buttonWidth;
            List<Candidates> _c;
            string techGUID;

            public ImplementSwipeHelper(Context context, RecyclerView recyclerView, int buttonWidth, List<Candidates> c, string technology) : base(context, recyclerView, buttonWidth)
            {
                this.context = context;
                this.recyclerView = recyclerView;
                this.buttonWidth = buttonWidth;
                this._c = c;
                techGUID = technology;

            }
            public ImplementSwipeHelper(Context context, RecyclerView recyclerView, int buttonWidth) : base(context, recyclerView, buttonWidth)
            {
                this.context = context;
                this.recyclerView = recyclerView;
                this.buttonWidth = buttonWidth;

            }
            public void refreshVariables(List<Candidates> candidate, string technology)
            {
                this._c = candidate;
                techGUID = technology;
            }

            public override void InstanciateCustomButtom(RecyclerView.ViewHolder viewHolder, List<CustomButton> buffer)
            {
                //Add reject candidate button
                buffer.Add(new CustomButton(context, "Reject", 30, 0, "#ffa13535", new RejecCandidateButtonClick(this, _c, techGUID, recyclerView, context)));
                //Add accept candidate button
                buffer.Add(new CustomButton(context, "Accept", 30, 0, "#ff0bb930", new AcceptCandidateButtonClick(this, _c, techGUID, recyclerView, context)));
            }

            private class RejecCandidateButtonClick : CustomButtonClickListner
            {
                private ImplementSwipeHelper implementSwipeHelper;
                private List<Candidates> cs;
                private string techGUID;
                private RecyclerView recyclerView;
                private Context context;

                public RejecCandidateButtonClick(ImplementSwipeHelper implementSwipeHelper, List<Candidates> candidates, string technology, RecyclerView recyclerView, Context context)
                {
                    this.implementSwipeHelper = implementSwipeHelper;
                    this.cs = candidates;
                    techGUID = technology;
                    this.recyclerView = recyclerView;
                    this.context = context;
                }

                public void OnClick(int position)
                {
                    Candidates c = cs[position];
                    c.status = -1;
                    Toast.MakeText(implementSwipeHelper.context, $"Candidate {c.firstName} rejected!", ToastLength.Short).Show();
                    cs.Remove(c);
                    CandidateListRenew(cs, techGUID);
                }
                public void CandidateListRenew(List<Candidates> candidates, string tGUID)
                {
                    IfsAdapter menuAdapter = new IfsAdapter(context, candidates, tGUID);
                    recyclerView.HasFixedSize = true;
                    LinearLayoutManager layoutManager = new LinearLayoutManager(context);
                    recyclerView.SetLayoutManager(layoutManager);
                    recyclerView.SetAdapter(menuAdapter);
                }
            }

            private class AcceptCandidateButtonClick : CustomButtonClickListner
            {
                private ImplementSwipeHelper implementSwipeHelper;
                private List<Candidates> cs;
                private string techGUID;
                private RecyclerView recyclerView;
                private Context context;
                public AcceptCandidateButtonClick(ImplementSwipeHelper implementSwipeHelper, List<Candidates> candidates, string technology, RecyclerView recyclerView, Context context)
                {
                    this.implementSwipeHelper = implementSwipeHelper;
                    cs = candidates;
                    techGUID = technology;
                    this.recyclerView = recyclerView;
                    this.context = context;
                }

                public void OnClick(int position)
                {
                    Candidates c = cs[position];
                    c.status = 1;
                    Toast.MakeText(implementSwipeHelper.context, $"Candidate {c.firstName} accepted!", ToastLength.Short).Show();
                    cs.Remove(c);
                    CandidateListRenew(cs, techGUID);

                }
                //Function to reload the list when somo  candidate was accepted or rejected
                public void CandidateListRenew(List<Candidates> candidates, string tGUID)
                {
                    IfsAdapter menuAdapter = new IfsAdapter(context, candidates, tGUID);
                    recyclerView.HasFixedSize = true;
                    LinearLayoutManager layoutManager = new LinearLayoutManager(context);
                    recyclerView.SetLayoutManager(layoutManager);
                    recyclerView.SetAdapter(menuAdapter);
                }
            }
        }
